$(function($){$.fn.execJs=function(fn){var resp=[];if(this.length){var oArgs=$joq(arguments).toArray();oArgs.shift();this.each(function(id,el){try{resp[id]=fn.apply(el,oArgs);}catch(er){console.error(er);}});}return resp;};$.fn.execAttr=function(attr,args){if(typeof args!="string"&&typeof args!="object"&&!args){args=[];}var oArgs=$joq(arguments).toArray();oArgs.shift();oArgs.shift();var resp=[];this.each(function(id,el){if(!$(el).is("["+attr+"]["+attr+'!=""]')){return(resp[id]=undefined);}try{resp[id]=Function(args,$(el).attr(attr)).apply(el,oArgs);}catch(er){console.error(er);}});return resp;};$.fn.countdown=function(){this.filter('[countdown][countdown!=""]').each(function(k,el){var count=parseInt($(el).attr("countdown-count"));var time=parseInt($(el).attr("countdown-time"));if(isNaN(count)){count=1;}if(isNaN(time)){time=1000;}var fnEach=Function("count,time",$(el).attr("countdown"));var fnEnd=Function("",$(el).attr("countdown-end"));var i=setInterval(function(){if(--count>=0){fnEach.apply(el,[count,time]);}else{if(count<0){clearInterval(i);fnEnd.apply(el);}}},time);});return this;};});